import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var MoveHorizontal = createReactComponent("MoveHorizontal", ["svg", defaultAttributes, [["polyline", {
  points: "18 8 22 12 18 16",
  key: "1eylrn"
}], ["polyline", {
  points: "6 8 2 12 6 16",
  key: "1dpeq5"
}], ["line", {
  x1: "2",
  y1: "12",
  x2: "22",
  y2: "12",
  key: "1vcgga"
}]]]);
export default MoveHorizontal;
